script: |
  super -f text -I q10810.spq | sort > q10810.out

inputs:
  - name: q10810.spq
    data: |
      SELECT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT col2 * + + ( + col2 ) * - col0 / - - col0 BETWEEN ( 47 * + col2 * + 34 * + + 21 ) AND NULL;
  - name: tab2

outputs:
  - name: q10810.out
    data: |
      46	51	23
      64	77	40
      75	67	58
